import React from 'react';
import Nav from 'react-bootstrap/Nav';
import kitty from '../images/orange_cat.png';

export default function Navbar() {
    return (
        // <>
        //     <Nav defaultActiveKey="/home" class="navbar navbar-expand-lg navbar-dark bg-dark">
        //         <Nav.Link href="https://github.com/ilgharr">github</Nav.Link>
        //         <img src={kitty} className="kitty" alt="logo orange cat image"/>
        //     </Nav>
        // </>

        <Nav
            activeKey="/home"
            onSelect={(selectedKey) => alert(`selected ${selectedKey}`)}
        >
            <Nav.Item>
                <Nav.Link href="/home">Active</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="link-1">Link</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="link-2">Link</Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link eventKey="disabled" disabled>
                    Disabled
                </Nav.Link>
            </Nav.Item>
        </Nav>
    )
}
